import {useDfpSlot} from "./useAdSlot";

const Header = ({ onclick }) => {

    useDfpSlot({
        path: '/6355419/Travel',
        size: [728, 90],
        id: 'header-slot',
    });

    return(
            <header>
                <p>Header</p>
                <div id="header-slot"
                onClick={(e) => onclick}></div>
            </header>

    )
};

export default Header;
